import axios from "axios";

export default {
  // Gets all books
  getTops: function() {
    return axios.get("/api/clothes/tops");
  },
  getShoes: function() {
    return axios.get("/api/clothes/shoes");
  },
  getOuterwear: function() {
    return axios.get("/api/clothes/outerwear");
  },
  getBottoms: function() {
    return axios.get("/api/clothes/bottoms");
  },
  getAll: function() {
    return axios
      .get("/api/clothes/bottoms")
      .then(() => axios.get("/api/clothes/tops"))
      .then(() => axios.get("/api/clothes/shoes"))
      .then(() => axios.get("/api/clothes/outerwear"));
  }
